/**
 * Common functions
 *
 * @module Common
 */
/**
 * Get the string representation of a value
 *
 * 获取值的字符串表示
 *
 * @category Common
 */
export declare function toString(s: unknown): string;
/**
 * Get type name of a value
 *
 * 获取值的类型名称
 *
 * @category Common
 * @example
 * ```ts
 * getTypeName(null) // => 'null'
 * getTypeName(undefined) // => 'undefined'
 * getTypeName({}) // => 'object'
 * ```
 */
export declare function getTypeName(s: unknown): string;
